TX = ''

OUT_ADDR = 'bcrt1q37eawpk6wtn39jxnnmat0ggf85f0h6mtuhxxu3'

# Create one-input, one-output, no-fee transaction:
class NobleTest(BitcoinTestFramework):

    def set_test_params(self):
        self.num_nodes = 1
        self.extra_args = [
            ["-walletrbf=1", "-addresstype=bech32", "-changetype=bech32"], 
        ]
        self.setup_clean_chain = True
        self.supports_cli = False

    def skip_test_if_missing_module(self):
        self.skip_if_no_wallet()

    def run_test(self):
        node = self.nodes[0]
        # Do deterministic tests
        node.setmocktime(1600000000)

        # Last block before anything
        assert_equal(node.getbestblockhash(), '0f9188f13cb7b2c71f2a335e3a4fc328bf5beb436012afca590b1a11466e2206')
        # Generate 10 block + 100 (for confirmations)
        self.generate(self.nodes[0], 110)
        assert_equal(self.nodes[0].getblockcount(), 110)
        assert_equal(node.getbestblockhash(), '195d93b456e568e11b2181715828f0e45543043d9635cbfa249a045c60aedf50')

        print('Chain', node.chain)
        w0 = node.get_wallet_rpc(self.default_wallet_name)
        # Add watch-only addresses
        node.createwallet(wallet_name='wo', disable_private_keys=True)
        wo_wallet = node.get_wallet_rpc('wo')
        for addr in ADDRS:
            wo_wallet.importaddress(address=addr)
        # Add watch-only ouput address
        node.createwallet(wallet_name='wout', disable_private_keys=True)
        wout_wallet = node.get_wallet_rpc('wout')
        wout_wallet.importaddress(address=OUT_ADDR)
        # Verify balance
        assert_equal(w0.getbalances()['mine']['trusted'], 500)
        print('W0 balances/0', w0.getbalances()['mine']['trusted'])
        # Send 1.5 btc to each address (so there will be some amount for fee)
        inputs = []
        for t in w0.listtransactions(count=1000):
            if t['blockheight'] < 11:
                inputs.append({'txid': t['txid'], 'vout': t['vout']})

        print('INPUTS', inputs)

        # 1.5 btc to each address (0.5 for fee)
        outputs = dict([(a, 1.5) for a in ADDRS])
        rawTx = ''

        # To verify that tx is deterministic
        rawTxSigned = node.signrawtransactionwithkey(rawTx, ['cVpF924EspNh8KjYsfhgY96mmxvT6DgdWiTYMtMjuM74hJaU5psW'])['hex']
        assert_equal(rawTxSigned, '')
        # Send tx
        node.sendrawtransaction(hexstring=rawTxSigned, maxfeerate=0)

        self.generate(node, 1)
        # At this point we finally send tx to our addresses...
        assert_equal(node.getbestblockhash(), '603207f0fd87b8d562ac19727ed7409b2f39204b094f37352b30e81c5da1001b')

        # Verify watch-only wallet balances
        print('WO balances/0', wo_wallet.getbalances()['mine']['trusted'])
        assert_equal(wo_wallet.getbalances()['mine']['trusted'], 127.5)

        tt =  wo_wallet.listtransactions()
        for i in tt:
            print('Z', i['address'], i['txid'], i['vout'])

        print('==== SEND RAW ====')
        pprint( node.decoderawtransaction(rawTxSigned))
        print('==== NOBLE RAW ====')
        pprint(node.decoderawtransaction(TX))

        node.sendrawtransaction(hexstring=TX, maxfeerate=0)
        # Everythign is send and works
        assert_equal(wo_wallet.getbalances()['mine']['trusted'], 0)
        # print('WO', wo_wallet.listtransactions())
        # print('LOL', node)

if __name__ == '__main__':
    NobleTest().main()
